import React from 'react';

//components
import QuestionPost from './QuestionPost';
import QuestionInput from './QuestionInput'

// data entry
import dummyData from '../questionPosts_db';

const MainFeed = () => {
    console.log(dummyData);

    return (
        <div className="main-feed" >
            <QuestionInput inputDetails={{ "image": "https://randomuser.me/api/portraits/women/32.jpg", "placeholder": "Ask a question" }} />

            {
                dummyData.map((questionDetails, id) => (
                    <QuestionPost key={id} questionDetails={questionDetails} />
                ))
            }

        </div>
    )


}

export default MainFeed;
